import WomanImg from '../img/about/woman.png';
import { Link } from 'react-router-dom';

const About = () => {
  return (
    <section className='section'>
      <div className='container mx-auto h-full relative'>
        {/* text image wrapper */}
        <div className='bg-pink-200 flex flex-col lg:flex-row h-full items-center justify-center gap-x-24 text-center lg: text-left lg: pt- '>
          {/* image */}
          <div>
            <img src={WomanImg} alt="About Woman" />
          </div>
          {/* text */}
          <div>
            <h2>About Us</h2>
            <p>Some description about the content.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
